import React from 'react';
import './App.css';
import Garden from "./component/Garden";

function App() {

  return (
      <div className="App">
          <h1>My Emoji Garden</h1>
          <Garden/>
          <button  type="submit" className="btn btn-primary mt-5" onClick={this} >Add a new garden</button>
      </div>
  );
}

export default App;
